    public long del1()
    {
        long st = 0;
        foreach (string baterija in inputLinja)
        {
            int mvolt = 0;
            for (int i = 0; i < baterija.Length - 1; i++)
            {
                int dodeset = baterija[i] - '0';
                for (int j = i + 1; j < baterija.Length; j++)
                {
                    int enota = baterija[j] - '0';
                    int tvolt = (dodeset * 10) + enota;
                    if (tvolt > mvolt)
                    {
                        mvolt = tvolt;
                    }
                }
            }
            st += mvolt;
        }
        return st;
    }

    public long del2()
    {
        long st = 0;
        int on = 12;
        foreach (string baterija in inputLinja)
        {
            int[] pos = new int[on];
            for (int i = 0; i < on; i++)
            {
                pos[i] = -1;
            }
            for (int x = 0; x < on; x++)
            {
                int top = 0;
                int zacetek = (x == 0) ? 0 : pos[x - 1] + 1;
                int konec = baterija.Length - (on - 1) + x;

                for (int battery = zacetek; battery < konec; battery++)
                {
                    int stevka = baterija[battery] - '0';
                    if (stevka == 9)
                    {
                        pos[x] = battery;
                        break;
                    }
                    if (stevka > top)
                    {
                        top = stevka;
                        pos[x] = battery;
                    }
                }
            }
            string bankJolt = "";
            for (int y = 0; y < on; y++)
            {
                bankJolt = bankJolt + baterija[pos[y]];
            }
            st += long.Parse(bankJolt);
        }
        return st;
    }
