    public long del1()
    {
        int rolls = 0;
        int rows = grid.Length;
        int cols = rows > 0 ? grid[0].Length : 0;
        for (int x = 0; x < rows; x++)
        {
            for (int y = 0; y < grid[x].Length; y++)
            {
                if (grid[x][y] == '.') continue;
                int adj = 0;
                if (x > 0 && y > 0 && y - 1 < grid[x - 1].Length && grid[x - 1][y - 1] == '@') adj++;
                if (x > 0 && y < grid[x - 1].Length && grid[x - 1][y] == '@') adj++;
                if (x > 0 && y + 1 < grid[x - 1].Length && grid[x - 1][y + 1] == '@') adj++;
                if (y > 0 && grid[x][y - 1] == '@') adj++;
                if (y + 1 < grid[x].Length && grid[x][y + 1] == '@') adj++;
                if (x < rows - 1 && y > 0 && y - 1 < grid[x + 1].Length && grid[x + 1][y - 1] == '@') adj++;
                if (x < rows - 1 && y < grid[x + 1].Length && grid[x + 1][y] == '@') adj++;
                if (x < rows - 1 && y + 1 < grid[x + 1].Length && grid[x + 1][y + 1] == '@') adj++;
                if (adj < 4)
                {
                    rolls++;
                }
            }
        }
        return rolls;
    }
