    public long del1()
    {
        var sortedRanges = ranges.OrderBy(r => r.Start).ToList();
        List<Range> mergedRanges = new List<Range>();

        foreach (var current in sortedRanges)
        {
            if (mergedRanges.Count == 0 || current.Start > mergedRanges.Last().End)
            {
                mergedRanges.Add(current);
            }
            else
            {
                var previous = mergedRanges.Last();
                mergedRanges[^1] = previous with
                {
                    End = Math.Max(previous.End, current.End)
                };
            }
        }

        long fresh = 0;
        foreach (var rang in mergedRanges)
        {
            fresh += (rang.End - rang.Start + 1);
        }
        return fresh;
    }
